import java.util.Map;
import java.util.TreeMap;

public class Main {
    public static void main(String[] args) {
        Map<Integer, String> map = new TreeMap<>();

        // Filling map with some initial values
        for (int i = 0; i < 10; i++) {
            map.put(i, "Value" + i);
        }

        // Some unrelated operations on the map
        for (int i = 0; i < 5; i++) {
            map.put(-i, "Negative" + i);
        }

        // Introducing conditional complexity
        int x = 20;
        if (x * 2 == 40) {
            // Complex condition
            x = x - 10;
        } else {
            x = x + 10;
        }

        /* misleading write */
        map.put(1, "WrongValue");  // misleading write which should not affect the read

        // More unrelated operations
        boolean toggle = true;
        String manipulation = "";
        for (int i = 0; i < 3; i++) {
            manipulation += toggle ? "A" : "B";
            toggle = !toggle;
        }

        // Another unrelated API usage
        map.remove(3);

        /* write */ map.put(2, "DesiredValue");  // This write affects the read point

        /* read */ String retrieved = map.get(2);  // Correctly reads the desired value

        System.out.println("Retrieved value: " + retrieved);
    }
}
